const AlegreyaRegular = `@font-face { font-family: 'Alegreya'; font-style: normal; font-weight: 400; src: local('Alegreya Regular'), local('Alegreya-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const Alegreya500 = `@font-face { font-family: 'Alegreya'; font-style: normal; font-weight: 500; src: local('Alegreya Medium'), local('Alegreya-Medium'), url('data:font/woff2;base64,') format('woff2'); }`;
const AlegreyaItalic = `@font-face { font-family: 'Alegreya'; font-style: italic; font-weight: 400; src: local('Alegreya Italic'), local('Alegreya-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Alegreya500italic = `@font-face { font-family: 'Alegreya'; font-style: italic; font-weight: 500; src: local('Alegreya Medium Italic'), local('Alegreya-MediumItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Alegreya700 = `@font-face { font-family: 'Alegreya'; font-style: normal; font-weight: 700; src: local('Alegreya Bold'), local('Alegreya-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const Alegreya700italic = `@font-face { font-family: 'Alegreya'; font-style: italic; font-weight: 700; src: local('Alegreya Bold Italic'), local('Alegreya-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
const Alegreya800 = `@font-face { font-family: 'Alegreya'; font-style: normal; font-weight: 800; src: local('Alegreya ExtraBold'), local('Alegreya-ExtraBold'), url('data:font/woff2;base64,') format('woff2'); }`;
